<html lang="it">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Sto Tornando!!</title>

  <style>
    :root{
      --card-bg: rgba(255,255,255,0.12);
      --card-border: rgba(255,255,255,0.22);
      --text: rgba(255,255,255,0.92);
      --muted: rgba(255,255,255,0.72);
      --shadow: rgba(0,0,0,0.30);

      --bar-bg: rgba(255,255,255,0.16);
      --bar-fill: rgba(255,255,255,0.80);

      --btn-bg: rgba(255,255,255,0.10);
      --btn-border: rgba(255,255,255,0.18);
      --btn-bg-hover: rgba(255,255,255,0.16);
    }

    * { box-sizing: border-box; }
    body {
      margin: 0;
      min-height: 100vh;
      display: grid;
      place-items: center;
      font-family: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial;
      color: var(--text);
      overflow-x: hidden;
      background: #0b0f18;
    }

    /* Background */
    .bg {
      position: fixed;
      inset: 0;
      background-size: cover;
      background-position: center;
      transform: scale(1.03);
      filter: saturate(1.05) contrast(1.05);
      z-index: -2;
    }

    /* Aurora */
    .aurora {
      position: fixed;
      inset: -20%;
      z-index: -3;
      background:
      radial-gradient(closest-side at 15% 25%, rgba(88, 255, 214, 0.55), transparent 60%),
      radial-gradient(closest-side at 75% 20%, rgba(129, 118, 255, 0.55), transparent 55%),
      radial-gradient(closest-side at 60% 80%, rgba(255, 116, 170, 0.45), transparent 55%),
      radial-gradient(closest-side at 25% 85%, rgba(255, 230, 135, 0.35), transparent 60%);

      filter: blur(22px) saturate(1.6) contrast(1.25);
      animation: floaty 14s ease-in-out infinite alternate;
      opacity: 1;
      transform-origin: center;
    }
    @keyframes floaty {
      from { transform: translate3d(-2%, -1%, 0) rotate(-2deg) scale(1.02); }
      to   { transform: translate3d( 2%,  1%, 0) rotate( 2deg) scale(1.06); }
    }

    /* Dark overlay for readability */
    .overlay {
      position: fixed;
      inset: 0;
      background:
        radial-gradient(1200px 600px at 20% 10%, rgba(0,0,0,0.25), transparent 60%),
        radial-gradient(900px 500px at 80% 90%, rgba(0,0,0,0.35), transparent 55%),
        linear-gradient(to bottom, rgba(0,0,0,0.40), rgba(0,0,0,0.62));
      z-index: -1;
    }

    .wrap {
      width: min(820px, 92vw);
      padding: 28px;
    }

    .card {
      background: var(--card-bg);
      border: 1px solid var(--card-border);
      border-radius: 18px;
      padding: 22px 22px 18px;
      box-shadow: 0 14px 40px var(--shadow);
      backdrop-filter: blur(14px);
      -webkit-backdrop-filter: blur(14px);
    }

    .topbar{
      display:flex;
      align-items:center;
      justify-content:space-between;
      gap:12px;
      margin-bottom: 14px;
      flex-wrap: wrap;
    }

    .pill {
      display: inline-flex;
      align-items: center;
      gap: 8px;
      padding: 6px 10px;
      border-radius: 999px;
      background: rgba(255,255,255,0.10);
      border: 1px solid rgba(255,255,255,0.16);
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
    }

    .dot {
      width: 8px;
      height: 8px;
      border-radius: 999px;
      background: rgba(255,255,255,0.85);
      opacity: 0.9;
    }

    button {
      appearance: none;
      border: 1px solid var(--btn-border);
      background: var(--btn-bg);
      color: var(--text);
      padding: 8px 12px;
      border-radius: 999px;
      font-size: 13px;
      font-weight: 600;
      cursor: pointer;
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
      transition: background 0.15s ease;
    }
    button:hover { background: var(--btn-bg-hover); }
    button:active { transform: translateY(1px); }
    button:focus { outline: 2px solid rgba(255,255,255,0.22); outline-offset: 2px; }

    h1 {
      margin: 0 0 6px;
      font-size: clamp(24px, 3.2vw, 34px);
      letter-spacing: 0.2px;
      font-weight: 700;
    }

    .sub {
      margin: 0 0 16px;
      color: var(--muted);
      font-size: 14px;
      line-height: 1.4;
    }

    .bar {
      height: 14px;
      width: 100%;
      background: var(--bar-bg);
      border: 1px solid rgba(255,255,255,0.18);
      border-radius: 999px;
      overflow: hidden;
    }

    /* Easing*/
    .fill {
      height: 100%;
      width: 0%;
      background: var(--bar-fill);
      border-radius: 999px;
      transition: width 0.70s cubic-bezier(.22, .61, .36, 1);
      will-change: width;
    }

    .row {
      display: flex;
      justify-content: space-between;
      gap: 12px;
      margin-top: 12px;
      flex-wrap: wrap;
      color: var(--muted);
      font-size: 13px;
    }

    .kpi {
      color: var(--text);
      font-variant-numeric: tabular-nums;
      letter-spacing: 0.2px;
    }

    .final {
      margin-top: 14px;
      padding-top: 14px;
      border-top: 1px solid rgba(255,255,255,0.18);
      display: none;
    }

    a {
      color: rgba(255,255,255,0.92);
      text-decoration: underline;
      text-decoration-color: rgba(255,255,255,0.45);
      word-break: break-word;
    }

    .hint {
      margin-top: 10px;
      color: rgba(255,255,255,0.55);
      font-size: 12px;
    }

    /* Star */
    .starWrap{
      position: relative;
      display: inline-flex;
      align-items: center;
      margin-left: 10px;
      cursor: pointer;
      user-select: none;
      -webkit-tap-highlight-color: transparent;
    }

    .star{
      display: inline-block;
      font-size: 16px;
      line-height: 1;
      opacity: 0.95;
      transform-origin: 50% 55%;
      animation: spin 2.6s linear infinite;
      filter: drop-shadow(0 0 0 rgba(255,255,255,0));
      transition: filter .18s ease, transform .18s ease;
    }

    @keyframes spin{
      from { transform: rotate(0deg); }
      to   { transform: rotate(360deg); }
    }

    /* microglow */
    .starWrap:hover .star,
    .starWrap.open .star{
      animation: spin 2.6s linear infinite, glowPulse 1.4s ease-in-out infinite alternate;
    }

    @keyframes glowPulse{
      from {
        filter:
          drop-shadow(0 0 10px rgba(255, 215, 0, 0.9))
          drop-shadow(0 0 22px rgba(255, 200, 0, 0.7))
          drop-shadow(0 0 40px rgba(255, 180, 0, 0.5));
      }
      to {
        filter:
          drop-shadow(0 0 18px rgba(255, 215, 0, 1))
          drop-shadow(0 0 36px rgba(255, 200, 0, 0.9))
          drop-shadow(0 0 60px rgba(255, 180, 0, 0.7));
      }
    }

    /* emoji */
    .pulseEmoji{
      display:inline-block;
      font-size:14px;
      line-height:1;
      margin-right:6px;
      transform-origin:center;
      animation: emojiPulse 1.8s ease-in-out infinite;
      filter: drop-shadow(0 0 6px rgba(255,255,255,0.18));
    }

    @keyframes emojiPulse{
      0%, 100% { transform: scale(1); opacity: 0.88; }
      50%      { transform: scale(1.18); opacity: 1; }
    }

    @media (prefers-reduced-motion: reduce){
      .pulseEmoji{ animation: none; }
    }

    /* fumetto */
    .bubble{
      position: absolute;
      left: 50%;
      bottom: calc(100% + 10px);
      transform: translateX(-50%) translateY(6px);
      padding: 8px 10px;
      border-radius: 12px;
      background: rgba(255,255,255,0.16);
      border: 1px solid rgba(255,255,255,0.22);
      color: rgba(255,255,255,0.92);
      font-size: 12.5px;
      white-space: nowrap;
      box-shadow: 0 12px 30px rgba(0,0,0,0.25);
      backdrop-filter: blur(12px);
      -webkit-backdrop-filter: blur(12px);
      opacity: 0;
      pointer-events: none;
      transition: opacity .15s ease, transform .15s ease;
    }

    /* codina del fumetto */
    .bubble::after{
      content: "";
      position: absolute;
      top: 100%;
      left: 50%;
      transform: translateX(-50%);
      border-width: 7px 7px 0 7px;
      border-style: solid;
      border-color: rgba(255,255,255,0.18) transparent transparent transparent;
      filter: drop-shadow(0 6px 10px rgba(0,0,0,0.25));
    }

    /* hover desktop */
    .starWrap:hover .bubble{
      opacity: 1;
      transform: translateX(-50%) translateY(0);
    }

    /* stato aperto via click/tap */
    .starWrap.open .bubble{
      opacity: 1;
      transform: translateX(-50%) translateY(0);
      pointer-events: auto;
    }

    /* alert integrit */
    .integrityBanner{
      position: fixed;
      bottom: 18px;
      left: 50%;
      transform: translateX(-50%);
      background: rgba(255, 60, 60, 0.78);
      color: white;
      padding: 10px 14px;
      border-radius: 14px;
      font-size: 14px;
      z-index: 9999;
      border: 1px solid rgba(255,255,255,0.25);
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
      box-shadow: 0 14px 40px rgba(0,0,0,0.35);
      max-width: calc(100vw - 24px);
      text-align: center;
    }

    @media (prefers-reduced-motion: reduce){
      .star{ animation: none; }
      .aurora{ animation: none; }
      .fill{ transition: none; }
    }
  </style>
</head>

<body>
  <!-- 26 Feb 2026 (Rome) -> 31 Aug 2026 23:59:59 (Rome) -->

  <div id="bg" class="bg"></div>
  <div class="aurora" aria-hidden="true"></div>
  <div class="overlay" aria-hidden="true"></div>

  <div class="wrap">
    <div class="card">
      <div class="topbar">
        <div class="pill">
          <span id="pulseEmoji" class="pulseEmoji" aria-hidden="true"></span>
          <span id="statusText">Tranquilli, sto tornando e manca poco.</span>

          <!-- STAR -->
          <span class="starWrap" id="starWrap" tabindex="0" aria-label="Star tooltip">
            <span class="star" aria-hidden="true"></span>
            <span class="bubble" id="starBubble" role="tooltip">Tu sei una stella pi bella!</span>
          </span>
        </div>

        <button id="refreshBgBtn" type="button">Bottone Magico</button>
      </div>

      <h1>Tranquilli, sto tornando e manca poco.</h1>

      <div class="bar" aria-label="progress bar">
        <div id="fill" class="fill"></div>
      </div>

      <div class="row">
        <div>Siamo gi a: <span id="pct" class="kpi">0.00%</span></div>
        <div>Mancano solo: <span id="rem" class="kpi"></span></div>
      </div>

      <div id="final" class="final">
        <div class="kpi">TORNATO!</div>
        <div style="margin-top:8px;">
          <a id="finalLink" href="#" rel="noopener">link</a>
        </div>
      </div>
    </div>
  </div>

<script>
  // START: 2026-02-26 00:00 Europe/Rome => 2026-02-25 23:00:00Z (CET)
  // END:   2026-08-31 23:59:59 Europe/Rome => 2026-08-31 21:59:59Z (CEST)
  const START = Date.parse("2026-03-01T00:00:00Z");
  const END   = Date.parse("2026-08-31T21:59:59Z");
  const FINAL_LINK = "https://youtu.be/DipzMtLBggc?si=kQwdFKT75JH1JKBI&t=80";

  // --- Integrity check ---
  function simpleHash(str){
    let h = 0;
    for (let i = 0; i < str.length; i++){
      h = (h << 5) - h + str.charCodeAt(i);
      h |= 0;
    }
    return h;
  }
  const EXPECTED_SIGNATURE = simpleHash(String(START) + String(END));

  function checkIntegrity(){
    const sig = simpleHash(String(START) + String(END));
    if (sig !== EXPECTED_SIGNATURE) {
      console.warn(" Integrity check failed: START or END modified.");
      if (!document.getElementById("integrityBanner")) {
        const warn = document.createElement("div");
        warn.id = "integrityBanner";
        warn.className = "integrityBanner";
        warn.textContent = "Integrity check failed: date modified";
        document.body.appendChild(warn);
      }
      return false;
    }
    return true;
  }


  const bg = document.getElementById("bg");
  const refreshBtn = document.getElementById("refreshBgBtn");

  function setRandomBackground(){
    bg.style.backgroundImage = `url("https://picsum.photos/1800/1200?ts=${Date.now()}")`;
  }
  setRandomBackground();
  refreshBtn.addEventListener("click", () => {
    pickEmoji();
    pickStarMessage();
    setRandomBackground();
  });

  const starWrap = document.getElementById("starWrap");
  function closeStar(){ starWrap.classList.remove("open"); }

  starWrap.addEventListener("click", (e) => {
    e.stopPropagation();
    pickStarMessage();          // nuova frase
    starWrap.classList.toggle("open");
  });
  starWrap.addEventListener("keydown", (e) => {
    if (e.key === "Enter" || e.key === " ") {
      e.preventDefault();
      starWrap.classList.toggle("open");
    }
  });
  document.addEventListener("click", () => closeStar());
  document.addEventListener("keydown", (e) => {
    if (e.key === "Escape") closeStar();
  });
  const emojiEl = document.getElementById("pulseEmoji");
  const EMOJIS = [
  "","","","","","","","","",
  "","","","","","","","","",
  "","","","","","","","","",
  "","","","","","","","","",
  "","","","","","","","","",
  "","","","","","","","",
  "","","","","","","","","",
  "","","","","","","","",
  "","","","","","",
  "","","","","","",
  "","","","","",
  "","","","","",
  "","","","","",
  "","","","","",
  "","","","",
  "","","","",""
];
const STAR_MESSAGES = [
  "Tu sei una stella pi bella!",
  "Sei pi stella della stella!",
  "Dalle stalle alle stelle!",
  "Sono a studiare tabelle!",
  "Sar abbastanza tabello per fare colpo sulle tabelle?",
  "Stella fa rima con tabella!",
  "Stelle fa rima con tabelle!",
  "Tabelle antiaderenti!",
  "Tabella e la bestia!",
  "Tabella addormentata nel bosco!"
];
const starBubble = document.getElementById("starBubble");

function pickStarMessage(){
  starBubble.textContent =
    STAR_MESSAGES[Math.floor(Math.random() * STAR_MESSAGES.length)];
}

  function pickEmoji(){
    emojiEl.textContent = EMOJIS[Math.floor(Math.random() * EMOJIS.length)];
  }

pickEmoji();

const CHANGE_EVERY_MS = 30 * 60 * 1000;
if (CHANGE_EVERY_MS > 0) setInterval(pickEmoji, CHANGE_EVERY_MS);
  // Progress
  const fill = document.getElementById("fill");
  const pct  = document.getElementById("pct");
  const rem  = document.getElementById("rem");
  const fin  = document.getElementById("final");
  const finA = document.getElementById("finalLink");
  const statusText = document.getElementById("statusText");

  function clamp(x, a, b){ return Math.max(a, Math.min(b, x)); }

  function fmtRemaining(ms){
    ms = Math.max(0, ms);
    const s = Math.floor(ms/1000);
    const d = Math.floor(s/86400);
    const h = Math.floor((s%86400)/3600);
    const m = Math.floor((s%3600)/60);
    const ss = s%60;
    return `${d}d ${String(h).padStart(2,"0")}:${String(m).padStart(2,"0")}:${String(ss).padStart(2,"0")}`;
  }

  function tick(){
    checkIntegrity();

    const now = Date.now();
    const total = END - START;
    const prog = clamp((now - START) / total, 0, 1);

    // Easing
    fill.style.width = (prog * 100).toFixed(2) + "%";
    pct.textContent = (prog * 100).toFixed(2) + "%";
    rem.textContent = fmtRemaining(END - now);

    if (prog >= 1){
      statusText.textContent = "Completed";
      fin.style.display = "block";
      finA.href = FINAL_LINK;
      finA.textContent = FINAL_LINK;
    } else if (now < START) {
      statusText.textContent = "See you soon!";
      fin.style.display = "none";
    } else {
      statusText.textContent = "Sto tornando";
      fin.style.display = "none";
    }
  }

  tick();
  setInterval(tick, 1000);
</script>
</body>
</html>
